  \"fort-peck-game-range-refuge-narrative-report-january-february-march-april-1954\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Fort Peck NWR
  and the easement refuges outlines Refuge accomplishments from January through April
  of 1954. The report begins by summarizing the weather conditions and water conditions
  during this period. Wildlife- including migratory birds, upland game birds, big
  game animals, furbearers, predators, rodents, mammals, raptors, and fish- is also
  covered. The Refuge development and maintenance section discusses physical developments.
  Resource management is outlined; topics include fur harvesting and timber removal.
  A progress report on field investigations and applied research is also provided.
  The public relations section of the report describes recreational uses, Refuge visitors,
  Refuge participation, and fishing. Items of interest, N-R forms, and photographs
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
